INSERT INTO `editable_page` VALUES (1,'controls','Controls','<p>Lighting can be controlled manually or through partial or complete automation. It is important to get the correct balance between relying too heavily on occupants to remember to switch light on and off appropriately, and removing any control occupants have which can often lead to frustration. In severe cases, automated systems may be tampered with and over ridden, increasing the energy consumption by disabling any means by which to turn lights off.</p>\n\n<p>The list below shows the most common forms of lighting control used in the UK. These options can be used independently or grouped together to provide more (or less) automation:</p>\n\n<ul>\n<li>Timer controls</li>\n<li>PIR controls (motion sensors)</li>\n<li>Lux controls (lighting level sensors)</li>\n<li>Dimmer switches</li>\n<li>Light switches</li>\n</ul>        ',NULL,'2010-08-13 00:53:03',1),(2,'developments','Developments','<h2>Energy Efficient Lighting</h2>\n\n<p>Improving the energy efficiency of your lighting systems comes down to the type of light bulbs you use and the way that you control the operation of those light bulbs. The first of these factors is about selecting low energy alternatives to traditional light bulbs which use less energy to create the same light output. The second factor is about ensuring that lights are only used in areas and at times that they are needed.</p>\n\n<h3>Low energy light bulbs</h3>\n\n<p>Light bulb technology has moved on significantly in recent years and is still developing rapidly. If appropriately selected, low energy light bulbs can provide exactly the same functionality as traditional light bulbs, with substantially lower energy demands. Low energy alternatives to traditional bulbs are very often now available with the same light intensity, colour output, look and dim-ability. Good quality low energy bulbs can warm up instantly, avoiding the initial dimness originally associated with them. Additionally, low energy light bulbs generally have a much longer life expectancy than traditional bulbs, reducing the payback period through reduce purchase and maintenance costs.</p>\n\n<figure id=\"1\">\n<table>\n  <tr><th>Traditional bulbs</th>  <th>Low energy alternatives</th></tr>\n  <tr><td>25W</td>                <td>5-7W</td></tr>\n  <tr><td>40W</td>                <td>8-9W</td></tr>\n  <tr><td>60W</td>                <td>11-14W</td></tr>\n  <tr><td>100W</td>               <td>20-23W</td></tr>\n</table>\n<legend>Figure 1: comparative electricity use of traditional and low energy alternative light bulbs.</legend>\n</figure>\n\n<p>Ten key points for efficient lighting operation:</p>\n\n<ol>\n  <li>Automated on/off periods should be set according to the current occupancy patterns of the area being lit.</li>\n  <li>PIR sensors should be located in appropriate positions. They should not be placed where they will be triggered unnecessarily. They should also be placed appropriate to the zone they are controlling.</li>\n  <li>PIR .on. periods should be set appropriately so that they switch off shortly after the space has become unoccupied, but not so quickly that there is a chance they will switch off while someone is sitting stationary in the room.</li>\n  <li>Lux level sensors should be located in appropriate positions. They should measure light levels in the dimmest area of the room to ensure this part always has sufficient light. Alternatively, the dimmest area could benefit from extra localised lighting so that the rest of the area is not over lit by the lux level sensor compensating for this part of the room. </li>\n  <li>Where occupants require different lighting levels, install localised luminaires, such as desk lamps, to provide increased lighting levels only as needed. </li>\n  <li>Consider removing dimmer switches if not completely necessary to the function of the room. Contrary to popular belief, reducing the light output by using a dimmer switch can actually increase the electricity consumption of the bulb, and decrease its life expectancy. </li>\n  <li>Use stickers next to light switches to remind occupants to switch the lights off when the area is not being used. </li>\n  <li>Consider re-wiring luminaires so that they can be switched on in rows parallel to any natural light sources. This will allow occupants furthest away from windows to have artificial lighting when those sitting nearest to the windows don.t necessarily need it on. Label banks of light switches to allow occupants to easily identify only those lights which they need to have switched on.</li>\n  <li>Always maximise the natural light available through windows and sky lights. Ensure that glazing is cleaned regularly and encourage staff to keep blinds open. If glare is an issue, consider fitting solar film to the affected windows. </li>\n</ol>\n\n<p>Communicate all control set ups to occupants so that they are aware of the reasons behind any changes and understand why and how the lights are being controlled in the way they are. This should help to reduce any potential occupant dissatisfaction caused by the perception of having no control over lighting.</p>\n',NULL,NULL,1);
